import React from 'react';

const ProgramsPage = () => {
  return (
    <div className="programs-page">
      <div className="page-header">
        <div className="container">
          <h1>Our Programs</h1>
          <p>Discover our comprehensive range of math and science programs</p>
        </div>
      </div>
      <div className="container">
        <h2>Programs Coming Soon!</h2>
        <p>We're working on amazing programs for you. Check back soon!</p>
      </div>
    </div>
  );
};

export default ProgramsPage;
